import React from "react";
import "./Styles.css";
import "./site.css";
import map from "./map";
import Nav from "./Nav";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
function Contact() {
  return (
    <Router>
      <Nav />
      <Switch>
        <Route path="/Contact" exact component={map} id="app" />
      </Switch>
    </Router>
  );
}

export default Contact;
